        res.body.should.be.an('object');
        res.body.should.have
          .property('msg')
          .equal('"lastName" is not allowed to be empty');

        done();
      });
  });

  it('User should not create an account when account type is not provided', (done) => {
    const data = {
      firstName: 'solomon',
      lastName: 'Rock',
      type: '',
      openBalance: 1000,
      email: 'solo@yahoo.com',
